import React from 'react'

export const CheckboxNormal = props => {
  const { id, handleCheckElement, isChecked, value } = props
  return (
    <label htmlFor={id}>
      <input
        key={id}
        onClick={handleCheckElement}
        type='checkbox'
        checked={isChecked}
        value={value}
      />{' '}
      {value}
    </label>
  )
}

export default CheckboxNormal
